static int build_zone_info(zone_info_t * tz_info, const char * info, int info_len, const char * name, int name_len){
  int rc;
  char * buf = (char*) vm_malloc(4 + info_len);
  memset(buf, 0, 4 + info_len);
  memcpy(buf, name, name_len);
  memcpy(&buf[4], info, info_len);
  rc = tt_time_build_zone_info(tz_info, buf, 4 + info_len);
  vm_free(buf);
  return rc;
};

